    ["IceCarve"] = function()
        ---@class Action
        local Action = getfenv().Action

        ---@module Modules.Globals.Mantra
        local Mantra = getfenv().Mantra

        ---@class Signal
        local Signal = getfenv().Signal

        ---Module function.
        ---@param self AnimatorDefender
        ---@param timing AnimationTiming
        return function(self, timing)
        	timing.ffh = true
        	timing.pfh = true
        	timing.fhb = true
