        	action._when = 0
        	action._type = "Dodge"
        	action.hitbox = Vector3.new(25, 70, 25)
        	action.name = "Normal Kick Timing"

        	local lastTimestamp = os.clock()

        	while task.wait() do
        		if (os.clock() - lastTimestamp) > (0.6 - Latency.rtt()) then
        			break
