    ["TelegraphMinor"] = function()
        ---@type Action
        local Action = getfenv().Action

        ---@module Modules.Globals.Waiter
        local Waiter = getfenv().Waiter

        -- Services.
        local players = game:GetService("Players")

        ---Module function.
        ---@param self SoundDefender
        ---@param timing SoundTiming
        return function(self, timing)
        	if not self.owner then
        		return
        	end

        	if players:GetPlayerFromCharacter(self.owner) then
        		local humanoid = self.owner:FindFirstChildOfClass("Humanoid")
        		if not humanoid then
        			return
        		end

        		local animator = humanoid:FindFirstChildOfClass("Animator")
        		if not animator then
        			return
        		end

        		if not Waiter.ftrack("rbxassetid://8172871094", animator) then
        			return
        		end

        		timing.fhb = true

        		local action = Action.new()
        		action._when = 350
        		action._type = "Dodge"
        		action.hitbox = Vector3.new(20, 20, 50)
        		action.name = "Kyrsieger Timing"
        		return self:action(timing, action)
        	end

        	if self.owner.Name:match("gigamed") then
        		timing.fhb = false

        		local action = Action.new()
        		action._when = 0
        		action._type = "Dodge"
        		action.hitbox = self.owner.Name:match("king") and Vector3.new(100, 100, 100) or Vector3.new(30, 30, 30)
        		action.name = "Gigamed Shock Timing"
        		return self:action(timing, action)
        	end
        end
    end,
    ["TerrapodBarrage"] = function()
        ---@module Utility.Signal
        local Signal = getfenv().Signal

        ---@class Action
        local Action = getfenv().Action

        ---Module function.
        ---@param self AnimatorDefender
        ---@param timing AnimationTiming
        return function(self, timing)
        	local count = 1

        	---Handler for barrage iteration.
        	local function onBarrageIteration()
        		-- Increment count.
        		count = count + 1

        		-- Handle first swing.
        		local actionOne = Action.new()
        		actionOne._when = 900
        		actionOne._type = "Parry"
        		actionOne.hitbox = Vector3.new(20, 25, 23)
        		actionOne.name = string.format("(%d) Terrapod Barrage Swing 1", count)
        		self:action(timing, actionOne)

        		if count > 1 then
        			actionOne._when = 400
        		end

        		-- Handle second swing.
        		local actionTwo = Action.new()
        		actionTwo._when = 1400
        		actionTwo._type = "Parry"
        		actionTwo.hitbox = Vector3.new(20, 25, 23)
        		actionTwo.name = string.format("(%d) Terrapod Barrage Swing 2", count)
        		self:action(timing, actionTwo)

        		if count > 1 then
        			actionTwo._when = 1100
        		end
        	end

        	local didLoopSignal = Signal.new(self.track.DidLoop)

        	self.tmaid:add(didLoopSignal:connect("TerrapodBarrage_DidLoop", onBarrageIteration))

        	onBarrageIteration()
        end
    end,
