local INTERNAL_GLOBALS = {
    ["Mantra"] = function()
        -- Mantra module.
        local Mantra = {}

        ---Get data.
        ---@param entity Model The entity to get the mantra data from.
        ---@param name string The name of the mantra.
        ---@return table?
        function Mantra.data(entity, name)
        	local player = game:GetService("Players"):GetPlayerFromCharacter(entity)
        	local backpack = player and player:FindFirstChild("Backpack")

        	local mantra = backpack and backpack:FindFirstChild(name)

        	local rs = mantra and mantra:GetAttribute("RichStats")
        	local bsp = rs and string.match(rs, "%[Blast%]")
        	local dsc = rs and string.match(rs, "(%d+)%s*[xX]%s*Drift Shard")
        	local rsc = rs and string.match(rs, "(%d+)%s*[xX]%s*Rush Shard")
        	local plc = rs and string.match(rs, "(%d+)%s*[xX]%s*Perfect Lens")
        	local clc = rs and string.match(rs, "(%d+)%s*[xX]%s*Crystal Lens")
        	local stc = rs and string.match(rs, "(%d+)%s*[xX]%s*Stratus Stone")
        	local csc = rs and string.match(rs, "(%d+)%s*[xX]%s*Cloudstone")
        	local gsc = rs and string.match(rs, "(%d+)%s*[xX]%s*Glass Stone")
        	local msc = rs and string.match(rs, "(%d+)%s*[xX]%s*Magnifying Stone")

        	return {
        		blast = bsp and true or false,
        		drift = dsc and tonumber(dsc) or 0,
        		rush = rsc and tonumber(rsc) or 0,
        		perfect = plc and tonumber(plc) or 0,
        		crystal = clc and tonumber(clc) or 0,
        		stratus = stc and tonumber(stc) or 0,
        		cloud = csc and tonumber(csc) or 0,
        		glass = gsc and tonumber(gsc) or 0,
        		magnifying = msc and tonumber(msc) or 0,
        	}
        end

        -- Return Mantra module.
        return Mantra
    end,
    ["ProjectileListener"] = function()
        ---@note: The goal of this module is to be able to not have duplicates of handling of a projectile.
        --- Normal child added signals will not work with multiple-same modules running because they will all create their own listener.
        --- This module will prioritize only the last created listener, which will be the one that is used to handle the projectile. The last one will be discarded.

        ---@class Maid
        local Maid = getfenv().Maid

        ---@class Signal
        local Signal = getfenv().Signal

        ---@class Logger
        local Logger = getfenv().Logger

        ---@class ProjectileListener
        ---@field maid Maid
        ---@field identifier string
        local ProjectileListener = {}
        ProjectileListener.__index = ProjectileListener

        -- Object list.
        local trackerObjects = {}

        ---Detach function.
        function ProjectileListener.detach()
        	for _, trackerObject in next, trackerObjects do
        		if not trackerObject.maid then
        			continue
        		end

        		trackerObject.maid:clean()
        	end
        end

        ---Create connection.
        function ProjectileListener:connect(callback)
        	local thrown = workspace:WaitForChild("Thrown")
        	local childAdded = Signal.new(thrown.ChildAdded)

        	self.maid:clean()

        	self.maid:mark(
        		childAdded:connect(string.format("%s_ProjectileListener_ThrownChildAdded", self.identifier), callback)
        	)
        end

        ---Create a new ProjectileListener object.
        ---@param identifier string
        ---@return ProjectileListener
        function ProjectileListener.new(identifier)
        	local self = setmetatable({}, ProjectileListener)
        	self.maid = Maid.new()
        	self.identifier = identifier
        	trackerObjects[#trackerObjects + 1] = self
        	return self
        end

        -- Return ProjectileListener module.
        return ProjectileListener
    end,
    ["ProjectileTracker"] = function()
        ---@type Signal
        local Signal = getfenv().Signal

        ---@type Maid
        local Maid = getfenv().Maid

        ---@note: The goal of this module is to track projectiles --
        --- To be able to distribute each projectile to a specific, unique tracker which will handle it.
        --- It is not this case where: for each tracker, assuming that they were created in order of the projectiles being thrown,
        --- we can assume that the first projectiles that we find are the ones linked to a user. It is somewhat true but not something to rely on.

        ---@class ProjectileTracker
        ---@field projectile Instance
        local ProjectileTracker = {}
        ProjectileTracker.__index = ProjectileTracker

        -- Global list of projectiles that we need to skip.
        local seenProjectiles = {}

        -- Object list.
        local trackerObjects = {}

        -- Projectile tracker maid.
        local ptMaid = Maid.new()

        -- Initialize global signals.
        local thrown = workspace:WaitForChild("Thrown")
        local childAdded = Signal.new(thrown.ChildAdded)

        ---@note: Forced fully ordered from first to last projectile tracker.
        ptMaid:mark(childAdded:connect("ProjectileTracker_ThrownChildAdded", function(child)
        	for _, tracker in next, trackerObjects do
        		if tracker.projectile then
        			continue
        		end

        		if not tracker.callback(child) then
        			continue
        		end

        		if seenProjectiles[child] then
        			continue
        		end

        		tracker.projectile = child

        		seenProjectiles[child] = true
        	end
        end))

        ---Wait for the first projectile that was found.
        ---@return Instance
        function ProjectileTracker:wait()
        	repeat
        		task.wait()
        	until self.projectile

        	return self.projectile
        end

        ---Detach function. Module function. It is not related to the object itself.
        function ProjectileTracker.detach()
        	ptMaid:clean()
        end

        ---Create new ProjectileTracker object.
        ---@param callback fun(candidate: Instance): boolean
        ---@return ProjectileTracker
        function ProjectileTracker.new(callback)
        	local self = setmetatable({}, ProjectileTracker)
        	self.projectile = nil
        	self.callback = callback
        	trackerObjects[#trackerObjects + 1] = self
        	return self
        end

        -- Return ProjectileTracker module.
        return ProjectileTracker
    end,
    ["TerrainListener"] = function()
        ---@class Maid
        local Maid = getfenv().Maid

        ---@class Signal
        local Signal = getfenv().Signal

        ---@class Logger
        local Logger = getfenv().Logger

        ---@class TerrainListener
        ---@field maid Maid
