    ["Waiter"] = function()
        ---Waiter module.
        local Waiter = {}

        ---@module Game.Latency
        local Latency = getfenv().Latency

        ---Find a track.
        ---@param aid string Animation ID to look for.
        ---@param animator Animator The animator to search in.
        ---@return AnimationTrack?
        function Waiter.ftrack(aid, animator)
        	for _, track in next, animator:GetPlayingAnimationTracks() do
        		local animation = track.Animation
        		if not animation then
        			continue
        		end

        		if animation.AnimationId ~= aid then
        			continue
        		end

        		return track
        	end
        end

        ---Stepped wait.
        ---@param defender Defender
        ---@param time number The time to wait in seconds.
        ---@param callback function The callback to run.
        function Waiter.stw(defender, time, callback)
        	local lastTimestamp = os.clock()
        	local initialPing = Latency.rtt()

        	while (os.clock() - lastTimestamp) <= (time - initialPing) do
        		-- Wait.
        		task.wait()

        		-- Step.
        		callback()
        	end
        end

        ---Fetch a track.
        ---@param aid string Animation ID to look for.
        ---@param animator Animator The animator to search in.
        ---@return AnimationTrack?
        function Waiter.fet(aid, animator)
        	while task.wait() do
        		local track = Waiter.ftrack(aid, animator)
        		if not track then
        			continue
        		end

        		return track
        	end
        end

        -- Return Waiter module.
        return Waiter
    end,
    ["Weapon"] = function()
        ---@module Game.Timings.Action
        local Action = getfenv().Action

        -- Weapon module.
        local Weapon = {}

        ---Get equipped weapon data.
        ---@param entity Model
        function Weapon.data(entity)
        	local lh = entity:FindFirstChild("LeftHand")
        	local rh = entity:FindFirstChild("RightHand")
        	if not lh and not rh then
        		return
        	end

        	local hw = (lh and lh:FindFirstChild("HandWeapon")) or (rh and rh:FindFirstChild("HandWeapon"))
        	if not hw then
        		return
        	end

        	local hwstats = hw:FindFirstChild("Stats")
        	if not hwstats then
        		return
        	end

        	local ssv = hwstats:FindFirstChild("SwingSpeed")
        	if not ssv then
        		return
        	end

        	local lv = hwstats:FindFirstChild("Length")
        	if not lv then
        		return
        	end

        	local type = hw:FindFirstChild("Type")
        	if not type then
        		return
        	end

        	local nemesis = false

        	for _, inst in next, hw:GetChildren() do
        		if not inst:IsA("ParticleEmitter") then
        			continue
        		end

        		if inst.Texture ~= "rbxassetid://11889781532" then
        			continue
        		end

        		nemesis = true
        		break
        	end

        	return {
        		hw = hw,
        		ss = ssv.Value,
        		oss = ssv:GetAttribute("OldValue") or ssv.Value,
        		length = lv.Value,
        		type = type.Value or "N/A",
        		nemesis = nemesis,
        	}
        end

        -- Return Weapon module.
        return Weapon
    end
}

-- Module manager.
---@note: All globals get executed first but never ran. This gets set in the global environment of every future module after.
