			attributes = {
				weapon = {
					["Heavy Wep."] = character:GetAttribute("Stat_WeaponHeavy"),
					["Medium Wep."] = character:GetAttribute("Stat_WeaponMedium"),
					["Light Wep."] = character:GetAttribute("Stat_WeaponLight"),
