	groupbox:AddToggle("InfoSpoofing", {
		Text = "Enable Info Spoofing",
		Default = false,
		Callback = function(value)
			-- Only refresh if we've ever enabled this feature or we're currently enabling it.
			if value or hasEverBeenEnabled then
