			end

			-- We don't need to mark if we're disabling it.
			if not value then
				return
			end

			-- Spoof UI.
			Spoofing.sss(Configuration.expectOptionValue("SpoofedSlotString"))
			Spoofing.sds(Configuration.expectOptionValue("SpoofedDateString"))
